import { Component } from "react";
import StarRateIcon from '@material-ui/icons//StarRate';
import ShoppingCartIcon from '@material-ui/icons//ShoppingCart';
import RemoveRedEyeIcon from '@material-ui/icons//RemoveRedEye';


class Slider extends Component{
    render(){
        return(
            <div className="women-slider" style={{position:"relative"}}>
                 <a className="icon-product" href="/sp"><ShoppingCartIcon/></a>
             <a className="icon-product" href="/sp"><StarRateIcon/></a>
             <a className="icon-product" href="/sp"><RemoveRedEyeIcon/></a>
            <div className="women-content">
            <img src={this.props.img}/>
            <h4 style={{margin:"5px"}} className="women-heading">{this.props.title}</h4><ul className="stars">
            <li> <StarRateIcon/></li>
            <li> <StarRateIcon/></li>
            <li> <StarRateIcon/></li>
            <li> <StarRateIcon/></li>
            <li> <StarRateIcon/></li>
            </ul>
            <p className="price">{this.props.price}</p>
            </div>
            </div>

        )
    }
}
export default Slider
